import React from './React';
import {robots} from './robots';
import Cardlist from './Cardlist';
import SearchBox from './SearchBox';

class App extends Components {
	constructor(){
    	super()
    	this.state = {
    		robots: robots,
    		searchfield: ''
    	}    

	}
	render() {
		return (
			<div className='tc'>
				<h1>RoboFriends</h1>
				<SearchBox />
				<Cardlist robots={ this.state.robots }/>
			</div>	
		);

	}
}

export default App;
